const getEstatRestDataURLBase = "https://ec.europa.eu/eurostat/wdds/rest/data/";

/**
 * Build URL to fetch data from eurobase REST API.
 * @param {string} datasetCode The Eurobase dataset code
 * @param {object=} filters The filter parameters as for example: {key:value,key:[value1,value2,value3]}
 * @param {number=} lang
 * @param {number=} format
 * @param {number=} version
 */
const getEstatDataURL = function (datasetCode, filters, lang, format, version) {
	lang = lang || "en";
	format = format || "json";
	version = version || "2.1";
	var url = [];
	url.push(getEstatRestDataURLBase, "v", version, "/", format, "/", lang, "/", datasetCode, "?");
	if (filters)
		for (var param in filters) {
			var o = filters[param];
			if (Array.isArray(o))
				for (var i = 0; i < o.length; i++)
					url.push("&", param, "=", o[i]);
			else url.push("&", param, "=", o);
		}
	return url.join("");
};


